import React from 'react';

const quizset = [
  {
    question : "1+1 = ",
    options : [2, 3, 4, 5],
    correct_answer : 2
  },
  {
    question : "1+2=",
    options : [2,3,4,5],
    correct_answer : 3
  },
  {
    question : "2+3=",
    options : [3,4,5,6],
    correct_answer : 5
  }
];

class App extends React.Component{
  render(){
    const listitems = quizset.map((obj) => 
      <div key={obj.correct_answer}>
        <div>{obj.question}</div>
        {obj.options.map((option) => 
          <div key={option}>{option}</div>
        )}
      </div>
    );
    return (
     <div>
       <div>Hello world!!</div>
       {listitems}
       <div>bye World!!</div>
     </div>
    );
  }
}



export default App;
